						<div itemprop="articleBody">
		<p style="text-align: center;"><strong>Indkaldelse til Generalforsamling i Danske Kvindelige Lægers Forening</strong></p>
<p style="text-align: center;"><strong>Torsdag d. 26.april 2012</strong></p>
<p style="text-align: center;"><strong>Kl. 19.00</strong></p>
<p style="text-align: center;"><strong>Auditoriet, Hovedvejen, Indgang 14</strong></p>
<p style="text-align: center;"><strong>Frederiksberg Hospital</strong></p>
<p style="text-align: center;"><strong>Ndr. Fasanvej 57, 2000 Frederiksberg </strong></p>
<p style="text-align: center;"><strong>&nbsp;</strong></p>
<p>1.Valg af dirigent</p>
<p>2.Valg af referent.</p>
<p>3.Mundtlig beretning ved formanden</p>
<p>4.Godkendelse af regnskabet for 2011.</p>
<p>5.Godkendelse af budget for 2012.</p>
<p>6.Fastsættelse af kontingent.</p>
<p>7.Valg til bestyrelsen. Agnete Basbøll, Asma Bashir og Kirsten Salado- Rasmussen er på valg. Alle 3 er villige til genvalg. Margrethe Foss Hansen er udtrådt af bestyrelsen og er erstattet af 1. suppleant Birte Holm Sørensen. De resterende 2 suppleanter Maria Lippa og Ruth Sinding er villige til genvalg. Der skal således vælges 1 suppleant.</p>
<p>8.Valg af revisorer. Birgit Albrectsen og Birgitte Kobberbøl-Jensen &nbsp;er villige til genvalg.</p>
<p>9.Valg af kasserer. Ruth Sinding er villig til genvalg.</p>
<p>10.Eventuelt.</p>
<p>På bestyrelsens vegne</p>
<p>Agnete Basbøll</p>
<p>Hellerup d. 2. april 2012</p>
<p>Bemærk det ændrede mødested for generalforsamlingen</p>	</div>

	
